import React from 'react'
import {Row, Cell, Flex} from './layout'
import styled from 'styled-components'
import {fontSize} from 'styled-system'

const Option = styled.p`
  color: ${props => props.theme.colors.darkBlue};
  margin: 0;
  line-height: 1;
  text-align: left;
  font-size: 14px;
`

const CheckBox = styled.div`
  height: 20px;
  width: 20px;
  background-color: ${props => props.theme.colors.green};
  margin-right: 10px;
`

const CheckList = ({items}) => <Row style={{width: '100%'}} justifyContent="center">
    <Cell>
        {items.slice(0, 7).map(item => (
            <Flex height={40} alignItems="center"><CheckBox /><Option>{item}</Option></Flex>
        ))}
    </Cell>
    <Cell>
        {items.slice(7, 14).map(item => (
            <Flex height={40} alignItems="center"><CheckBox /><Option fontSize={[12, 14]}>{item}</Option></Flex>
        ))}
    </Cell>
</Row>

export default CheckList
